import "./styles.css";
import Home from "./routes/Home";
import Blogs from "./routes/Blogs";
import Htw from "./routes/Htw";
import Swo from "./routes/Swo";
import Contact from "./routes/Contact";
import { Route, Routes } from "react-router-dom";
import { createPath } from "react-router-dom";
import { BrowserRouter } from "react-router-dom/dist/umd/react-router-dom.development";
function App() {
  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Home />}></Route>
          <Route exact path="/blogs" element={<Blogs />}></Route>
          <Route exact path="/contact" element={<Contact />}></Route>
          <Route exact path="/how technology works" element={<Htw />}></Route>
          <Route exact path="/Solutions we offer" element={<Swo />}></Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
